        <Router>
            <NavigationBar />
            <Container style={containerStyle}>
                <Row>
                    <Col lg={12}>
                        <Routes>
                            <Route path="/" element={<Bienvenue />} />
                            <Route path="/add" exact element={<Voiture />} />
                            <Route path="/list" exact element={<VoitureListe />} />
                            <Route path="/*" element={<Navigate to="/" />} />
                        </Routes>
                    </Col>
                </Row>
            </Container>
            <Footer />
        </Router>
    );
}

export default App;
